import { AiOutlineArrowRight, AiOutlineArrowDown } from 'react-icons/ai';
import './ListProperties.css'
const ListProperties = ({image, name, created_by, description }) => {

  return(
    <Fragment>
      <ul className = 'list-properies'>
        <li><span className = 'imageContainer'><AiOutlineArrowRight/><h1>Image</h1></span></li>
        <li><span className = 'authorContainer'><AiOutlineArrowRight/><h1>Title</h1></span></li>
        <li><span className = 'created_byContainer'><AiOutlineArrowRight/><h1>Author</h1></span></li>
        <li><span className = 'durationContainer'><AiOutlineArrowRight/><h1>Description</h1></span></li>
      </ul>
   </Fragment>
  )
}
export default ListProperties;
